public class Livro {    private String titulo;    private String autor;    private int anoPublicado = 2024;    private boolean disponivel = true;    public Livro(String titulo, String autor, int anoPublicado, boolean disponivel) {        this.titulo = titulo;        this.autor = autor;        this.anoPublicado = anoPublicado;        this.disponivel = disponivel;    }    public Livro(String titulo, String autor) {        this.titulo = titulo;        this.autor = autor;    }    public String getTitulo() {        return titulo;    }    public String getAutor() {        return autor;    }    public int getAnoPublicado() {        return anoPublicado;    }    public boolean isDisponivel() {        return disponivel;    }    public void setTitulo(String titulo) {        this.titulo = titulo;    }    public void setAutor(String autor) {        this.autor = autor;    }    public boolean emprestar(){        if (disponivel == true) {            disponivel = false;            return true;        } else {            return false;        }    }    public void devolver(){        disponivel = true;    }    public String toString(){        return "titulo " + titulo  + " "                + "Autor " + autor  + " "                + "Ano Publicado " + anoPublicado  + " "                + "Disponivel " + disponivel;    }}